  border-color: #e94560;
  background: linear-gradient(135deg, #16213e, #1a1a2e);
}

.score-badge {
  display: inline-block;
  padding: 4px 8px;
  border-radius: 4px;
  font-weight: bold;
}

.score-high { background: #10b981; }
.score-medium { background: #f59e0b; }
.score-low { background: #ef4444; }

.modal {
  position: fixed;
  z-index: 1000;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0,0,0,0.8);
}

.modal-content {
  background-color: #16213e;
  margin: 5% auto;
  padding: 20px;
  border: 1px solid #0f3460;
  width: 90%;
  max-width: 600px;
  border-radius: 10px;
  max-height: 80vh;
  overflow-y: auto;
}

.close {
  color: #aaa;
  float: right;
  font-size: 28px;
  font-weight: bold;
  cursor: pointer;
}

.close:hover { color: #fff; }




